import React from "react";
import "./Home.css";
import Product from "./Product";

function Home() {
  return (
    <div className="home">
      <div className="home__container">
        <img
          className="home__image"
          src="https://i.pinimg.com/originals/36/a9/9f/36a99f74625db4d993210adcb7234120.jpg"
          alt=""
        />

        <div className="home__row">
          <Product
            id="2345678"
            title="'Yesillik' (Pack of 6)"
            price={159.99}
            image="https://i.pinimg.com/564x/97/f0/14/97f01469e46544c2662bd8e4cdb06a80.jpg"
            rating={5}
          />
          <Product
            id="2345678"
            title="100% Cotton Navy Pestemal with white lining set"
            price={39.99}
            image="https://cdn.turkishtowelsaustralia.com/wp-content/uploads/2020/07/Turkish-Hand-Towels-with-Fringe-Sultan-Peshtemal-Peshkir-Navy-Blue-1-510x341.jpg"
            rating={5}
          />
        </div>

        <div className="home__row">
          <Product
            id="2345678"
            title="100% Cotton Navy Pestemal with white lining set"
            price={99.99}
            image="https://cdn.turkishtowelsaustralia.com/wp-content/uploads/2020/07/Turkish-Hand-Towels-with-Fringe-Sultan-Peshtemal-Peshkir-Navy-Blue-1-510x341.jpg"
            rating={3}
          />
          <Product
            id="2345678"
            title="100% Cotton Navy Pestemal with white lining set"
            price={99.99}
            image="https://cdn.turkishtowelsaustralia.com/wp-content/uploads/2020/07/Turkish-Hand-Towels-with-Fringe-Sultan-Peshtemal-Peshkir-Navy-Blue-1-510x341.jpg"
            rating={3}
          />
          <Product
            id="123456"
            title="100% Cotton Navy Pestemal with white lining set"
            price={99.99}
            image="https://cdn.turkishtowelsaustralia.com/wp-content/uploads/2020/07/Turkish-Hand-Towels-with-Fringe-Sultan-Peshtemal-Peshkir-Navy-Blue-1-510x341.jpg"
            rating={3}
          />
        </div>

        <div className="home__row">
          <Product
            id="123456"
            title="100% Cotton Navy Pestemal with white lining set"
            price={99.99}
            image="https://images-na.ssl-images-amazon.com/images/I/71rkW5TiRTL._AC_SX522_.jpg"
            rating={3}
          />
        </div>
      </div>
    </div>
  );
}

export default Home;
